import React from 'react';
import {Text, View, StyleSheet} from 'react-native';

export default class PhotosScreen extends React.Component {
    render() {
        return (
            <View>
                <Text>Welcome to the photos view!</Text>
            </View>
        );
    }
}

const styles = StyleSheet.create({});
